import React from 'react';
import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import './App.css';
import { HomePage } from './layouts/HomePage/HomePage';
import { ControlPanel } from './layouts/HomePage/Components/ControlPanel';
import { Sound } from './layouts/HomePage/Components/Sound';
import { SongList } from './layouts/HomePage/Components/SongList';

function App() {
  return (
    <div>
    <BrowserRouter>
      <Routes>
      <Route path="sound/:key" component={SongList} />
      <Route index element={<HomePage />} />
        <Route path="Main" element={<ControlPanel/>} />
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
